import React, { Component } from 'react';
import './Home.css';

class Home extends Component {
    render() {
        return (
            <div id="home">
                <div className="row">
                    <div className="column">
                        <h1 className="name-container">D'Andre Campbell</h1>
                        <h3 className="title-container">Developer + Photographer</h3>                             
                    </div>
                    <div className="column"></div>
                </div>

            </div>
        )
    }
}

export default Home;
